def find_page_number(pages):
    wrong_pages = []
    last_page = 0

    for page_num in pages:
        if page_num == last_page + 1:
            last_page += 1
        else:
            wrong_pages.append(page_num)

    return wrong_pages

def find_page_number(pages):
    result = []
    for j, page in enumerate(pages):
        if page != j - len(result) + 1:
            result.append(page)

    return result

