def find_page_number(pages):
    r=[]
    i=0
    while i<len(pages):
        if pages[i]!=i+1:
            r.append(pages.pop(i))
            i-=1
        i+=1
    return r

def find_page_number(pages):
    p=pages[:]
    x=1
    r=[]
    while(p):
        if p[0]!=x:
            r.append(p.pop(0))
        else:
            x+=1
            p.pop(0)
    return r

def find_page_number(pages):
    arr,l=[],0
    for i,p in enumerate(pages,1):
        if p!=i-l:
            arr.append(p)
            l+=1
    return arr
